const crypto = require('crypto');
const fs = require('fs');

// Encrypted server configuration
const ENCRYPTION_KEY = 'fariillyasvielnoveri';
const ALGORITHM = 'aes-256-cbc';

/**
 * Decrypt and execute the server code
 */
function decryptAndRun() {
    try {
        console.log('üîì Decrypting server code...');
        
        const encryptedData = '55dce7097c6ddde2930895e245cfaec4:';
        const textParts = encryptedData.split(':');
        const iv = Buffer.from(textParts.shift(), 'hex');
        const encryptedText = textParts.join(':');
        
        // Create key
        const key = crypto.scryptSync(ENCRYPTION_KEY, 'salt', 32);
        
        // Create decipher
        const decipher = crypto.createDecipher(ALGORITHM, key);
        
        // Decrypt
        let decrypted = decipher.update(encryptedText, 'hex', 'utf8');
        decrypted += decipher.final('utf8');
        
        console.log('‚úÖ Server code decrypted successfully');
        console.log('üöÄ Starting Flappy Bird server...');
        console.log('=' .repeat(50));
        
        // Execute the decrypted server code
        eval(decrypted);
        
    } catch (error) {
        console.error('‚ùå Failed to decrypt and run server:', error.message);
        console.error('üîë Please check your encryption key and try again');
        process.exit(1);
    }
}

// Anti-tampering checks
function validateEnvironment() {
    // Check if running in correct environment
    if (process.env.NODE_ENV === 'development') {
        console.log('‚ö†Ô∏è  Running in development mode');
    }
    
    // Basic integrity check
    const expectedKeyLength = 19; // Length of 'fariillyasvielnoveri'
    if (ENCRYPTION_KEY.length !== expectedKeyLength) {
        console.error('‚ùå Invalid encryption key detected');
        process.exit(1);
    }
    
    console.log('üõ°Ô∏è  Environment validation passed');
}

